import React, { useState, useEffect } from 'react';
import { Layout, Menu, Input, Button, Space } from 'antd';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './Login';
import Logout from './Logout';
import PropertyInputPage from './PropertyInputPage';
import FilterModal from './components/FilterModal';
import PropertyList from './PropertyList';
import Contact from './Contact'; // Örnek bir Contact bileşeni

const { Header, Content, Footer } = Layout;

const HomePage = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <Layout className="layout">
        <Header>
          <div className="logo" />
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
            <Menu.Item key="1">
              <Link to="/">Ana Sayfa</Link>
            </Menu.Item>
            <Menu.Item key="2">
              <Link to="/property-list">Emlak Listesi</Link>
            </Menu.Item>
            <Menu.Item key="3">
              <Link to="/contact">İletişim</Link>
            </Menu.Item>
            {isLoggedIn ? (
              <Menu.Item key="4">
                <Link to="/logout">Çıkış Yap</Link>
              </Menu.Item>
            ) : (
              <Menu.Item key="4">
                <Link to="/login">Giriş Yap</Link>
              </Menu.Item>
            )}
          </Menu>
        </Header>
        <Content style={{ padding: '0 50px' }}>
          <div className="site-layout-content">
            <Routes>
              <Route
                path="/"
                element={
                  <>
                    <h1>Hoş Geldiniz!</h1>
                    <p>Evinizi bulmak artık çok daha kolay.</p>
                    <h2>Evinizi aramak için filtreleyin:</h2>
                    <Space>
                      <Input.Search placeholder="Evinizi arayın..." style={{ width: 200 }} />
                      <Button type="primary" style={{ marginTop: 10 }}>
                        Ara
                      </Button>
                      <FilterModal />
                    </Space>
                  </>
                }
              />
              <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
              <Route path="/logout" element={<Logout setIsLoggedIn={setIsLoggedIn} />} />
              <Route path="/property-input" element={<PropertyInputPage />} />
              <Route path="/property-list" element={<PropertyList />} />
              <Route path="/contact" element={<Contact />} />
            </Routes>
          </div>
        </Content>
        <Footer style={{ textAlign: 'center' }}>Emlakçı Otomasyonu ©2024 Created by You</Footer>
      </Layout>
    </Router>
  );
};

export default HomePage;
